description:
Cần bán ra mảnh đất tại Đặng Xá, Gia Lâm, Hà Nội:
- Dt 80m2, mt 6m, nở hậu;
- Đường xe máy, đi vài bước chân ra trục chính Viên Ngoại;
- Ngay gần trường học các cấp;
- Pháp lý đầy đủ sang tên;
- Giá siêu đẹp chỉ 3.6 tỷ (có thương lượng khi mua bán);
LH em qua sdt/zl để xem 24/7 và làm việc giá êm...
